import React from "react";

const Footer = () => {
    return (
        <footer className="footer">
            <p>&copy; 2025 Student News Hub. All rights reserved.</p>
            <nav>
                <a href="#">Privacy Policy</a> | <a href="#">Terms of Service</a>
            </nav>
        </footer>
    );
};

export default Footer;
